import {useState} from "react"

export default function Navbar({inputData, setLoc, setInputData}){

    function handleChange(event){
        const {name, value} = event.target
        if(inputData.loc == null){
            setInputData(prev =>({
                ...prev,
                [name]: "Arlington"
            }))
        }else{
            setInputData(prevEntry =>({
                ...prevEntry,
                [name]: value
            }))            
        }

    }
    function submitLoc(event){///Submits entered location and set loc to entry
        event.preventDefault()
        setLoc(inputData)
        console.log("Help" + inputData.loc)

        // if(inputData.loc == null){
        //     const {name, value} = event.target
        //     setInputData(prev =>({
        //         ...prev,
        //         [name]: "Arlington"
        //     }))
        // }
    }

    return(
        <form onSubmit={submitLoc} className="navbar">
            <input name="loc" onChange={handleChange} className="location-entry" type="text" placeholder="Location" />
            <button type="submit">Submit</button>
        </form>
    )
}
